from time import perf_counter

def moveZeroes(nums):
    """
    :type nums: List[int]
    :rtype: None Do not return anything, modify nums in-place instead.
    """
    start = perf_counter()
    zeros_count = 0
    for _ in range(len(nums)):
        try:
            nums.remove(0)
            zeros_count += 1
        except ValueError as e:
            # print(f"Value erro expected: {e}")
            # print(f"Zeroes counted: {zeros_count}")
            break
    
    nums.extend([0]*zeros_count)
    # print(nums)
    end = perf_counter()
    print(f"moveZeroes: {end-start}")

def moveZeroes_opt(nums):
    start = perf_counter()
    left = 0
    for i in range(len(nums)):
        if nums[i] != 0:
            nums[left], nums[i] = nums[i], nums[left]
            left += 1
    # print(nums)
    end = perf_counter()
    print(f"moveZeroes_opt: {end-start}")

if __name__ == "__main__":
    s = ''
    # s = '1101101011'
    a1 = [int(i) for i in list(s)]
    a2 = [int(i) for i in list(s)]
    moveZeroes(a1)
    # print(a1)
    moveZeroes_opt(a2)
    # print(a2)
